(function(){Vue.component("convos-message-notice",{mixins:[Convos.mixin.message],template:"<div :class=\"classNames()\" class=\"convos-message notice\">\n    <a @click.prevent=\"insertIntoInput\" class=\"title\" href=\"#{{msg.from}}\">{{msg.from}}</a>\n    <div class=\"message\">{{{message() | markdown}}}</div>\n    <span class=\"secondary-content ts\" v-tooltip=\"msg.ts.toLocaleString()\">{{msg.ts | timestring}}</span>\n  </div>\n"})})();